import React from 'react';

const Navbar = () => (
  <nav className="bg-blue-700 text-white py-4 shadow">
    <div className="max-w-7xl mx-auto flex items-center justify-between px-4">
      <div className="font-bold text-2xl md:text-3xl tracking-tight">Home Rental</div>
      <div className="space-x-4">
        {/* Add navigation links here as needed */}
        {/* Example: <a href="/" className="hover:underline">Home</a> */}
      </div>
    </div>
  </nav>
);

export default Navbar;
